import { useEffect, useState } from "react";
import axios from "axios";
import { Pie } from "react-chartjs-2";
import {
  Chart as ChartJS,
  ArcElement,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(ArcElement, Tooltip, Legend);

function App() {
  const [transactions, setTransactions] = useState([]);
  const [title, setTitle] = useState("");
  const [amount, setAmount] = useState("");
  const [category, setCategory] = useState("");
  const [type, setType] = useState("expense");

  const fetchTransactions = async () => {
    const res = await axios.get("http://localhost:5000/api/transactions");
    setTransactions(res.data);
  };

  useEffect(() => {
    fetchTransactions();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!title || !amount || !category) return;

    await axios.post("http://localhost:5000/api/transactions", {
      title,
      amount: Number(amount),
      category,
      type
    });

    setTitle("");
    setAmount("");
    setCategory("");
    setType("expense");

    fetchTransactions();
  };

  // ---------- Totals ----------
  const totalIncome = transactions
    .filter(t => t.type === "income")
    .reduce((s,t)=>s+t.amount,0);

  const totalExpense = transactions
    .filter(t => t.type === "expense")
    .reduce((s,t)=>s+t.amount,0);

  const balance = totalIncome - totalExpense;

  // ---------- Expense Chart ----------
  const expenseData = transactions.filter(t=>t.type==="expense");

  const grouped = expenseData.reduce((acc,t)=>{
    acc[t.category] = (acc[t.category] || 0) + t.amount;
    return acc;
  },{});

  const chartData = {
    labels: Object.keys(grouped),
    datasets: [{
      data: Object.values(grouped),
      backgroundColor: [
        "#F87171","#FB923C","#FACC15",
        "#4ADE80","#2DD4BF","#60A5FA",
        "#A78BFA","#F472B6"
      ]
    }]
  };

  return (
    <div className="container">
      <h1>Expense & Income Tracker</h1>

      <div className="summary">
        <div className="card income">Income: ₹{totalIncome}</div>
        <div className="card expense">Expense: ₹{totalExpense}</div>
        <div className="card balance">Balance: ₹{balance}</div>
      </div>

      <form onSubmit={handleSubmit} className="form">
        <select value={type} onChange={e=>setType(e.target.value)}>
          <option value="expense">Expense</option>
          <option value="income">Income</option>
        </select>

        <input placeholder="Title" value={title} onChange={e=>setTitle(e.target.value)} />
        <input placeholder="Amount" value={amount} onChange={e=>setAmount(e.target.value)} />
        <input placeholder="Category" value={category} onChange={e=>setCategory(e.target.value)} />

        <button>Add</button>
      </form>

      <h3>Spending Breakdown</h3>
      {expenseData.length > 0 ? (
        <Pie data={chartData} />
      ) : (
        <p>No expense data yet</p>
      )}

      <h3>All Transactions</h3>
      <ul>
        {transactions.map(t=>(
          <li key={t._id}>
            <strong>{t.type.toUpperCase()}</strong> — {t.title} — ₹{t.amount} — {t.category}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
